import React from 'react';
import marcLogo from './marcLogo.png';
import './Navigation.css';

const Navigation = () => {

	return (
		<div>
			<ul className='navBar'>
				<li><a href="#"><img className='marcLogo' alt='marcLogo' src={marcLogo}/> </a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>
			</ul>

			<div className='logo'>

			</div>
			<div className='about'>
				About
			</div>
			<div className='contact'>	
				Contact
			</div>
		</div>
	);
};

export default Navigation;
